import { configureStore } from "@reduxjs/toolkit";
import { categoriesReducer } from "./categoriesReducer";
import { productsReducer } from "./categoryReducer";

export const store = configureStore({
  reducer: {
    categoriesList: categoriesReducer,
    ca: productsReducer,
  },
});
